Since pa_utils_RemoveQuotationString also does a strncpy internally, this effectively copies the string three times.  Could be simplified to:

    strncpy(rqstPeriodicRauPtr, pRau, rqstPeriodicRauSize);
    rqstPeriodicRauPtr[rqstPeriodicRauSize] = '\0';
    pa_utils_RemoveQuotationString(rqstPeriodicRauPtr);

This also eliminates the need for the tempStr buffer.

I assume that APIs pass the number of characters that the string can hold, and not the byte length of the parameter?  If it is the latter, then rqstPeriodicRauPtr[rqstPeriodicRauSize] is wrong.

Same comments apply for the other parameters.

remove this part and add these comments to the parameter list of the function to be consistent others:
///< [IN] Buffer containing AT command string
///< [IN] Unwanted character to be removed

